import {CREATE_DATA, FLAG_CHANGE, START_POST_REQUEST} from "../types"

const saveDataStore = (data)=>{
    
    return {
        type: CREATE_DATA,
        payload: data
    }
}

const windowOpen = ()=>{
    return{ 
        type: FLAG_CHANGE
    }
}

const start_POST_RequestServer = ()=>{
    
    return{ 
        type: START_POST_REQUEST
    }
}


export {saveDataStore, windowOpen, start_POST_RequestServer}
